import styled from "styled-components";

export const ContentContainer = styled.div`
  height: 90px;
  padding: 0 25px;
  display: flex;
  position: absolute;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  border: 1px solid black;
  background-color: white;
  opacity: 0.7;
`;
